column4:
問題文 FizzBuzz列  a_1,a_2,... を次のように定めます。

i が 3 でも 5 でも割り切れるなら、a_i=\text{FizzBuzz}
そうではなく i が 3 で割り切れるなら、a_i=\text{Fizz}
そうではなく i が 5 で割り切れるなら、a_i=\text{Buzz}
そうではないなら、a_i=i

FizzBuzz列の N 項目までに含まれる数の和を求めてください。

問題文 FizzBuzz列  a_1,a_2,... を次のように定めます。

i が 3 でも 5 でも割り切れるなら、a_i=\text{FizzBuzz}
そうではなく i が 3 で割り切れるなら、a_i=\text{Fizz}
そうではなく i が 5 で割り切れるなら、a_i=\text{Buzz}
そうではないなら、a_i=i

FizzBuzz列の N 項目までに含まれる数の和を求めてください。

問題文非負整数 n, m に対して関数 f(n, m) を正の整数 K を用いて次のように定めます。
\displaystyle f(n, m) = \begin{cases} 0 & (n = 0) \\ n^K & (n \gt 0, m = 0) \\ f(n-1, m) + f(n, m-1) & (n \gt 0, m \gt 0) \end{cases}
N, M, K が与えられるので、f(N, M) を (10 ^ 9 + 7) で割った余りを求めてください。
